(function () {
  'use strict';

  var mod = angular.module('quoteApp');

  mod.controller('QuoteCreateController', QuoteCreateController);
  mod.config(routeConfig);

  function routeConfig($routeProvider) {
    $routeProvider
    .when('/', {
      templateUrl: 'scripts/quote-create.html',
      controller: 'QuoteCreateController',
      controllerAs: 'vm'
    });
  }

  QuoteCreateController.$inject = ['$location','$routeParams', 'validationUtils'];
  function QuoteCreateController ($location, $routeParams, validationUtils) {

    /* jshint validthis: true */
    var vm = this;

    vm.cancel = cancel;
    vm.save = save;
    vm.add = add;
    vm.remove = remove;
    vm.getItemTotalPrice = getItemTotalPrice;
    vm.getSubTotal = getSubTotal;
    vm.getVatTotal = getVatTotal;
    vm.getTotal = getTotal;

    vm.quote = {
      clientName: "xxxxxxx",
      clientAddress: "xxxx",
      clientTel: 2222222,
      clientCell: 3333333,
      clientFax: 444444,
      clientContact: "ffffffffffffffffff",
      clientDetails: "sdfsdfsdfsdf",
      items: [{        
        name: "window1",
        size: "222x300",
        qty: 1,
        description: "bla bgasdvsd svsw",
        unitPrice: 220
      }
      ]

    }

    function getItemTotalPrice(item) {
      // console.log("getItemTotals() ", item);

      var total = 0;
      if (item.unitPrice != undefined && item.qty != undefined) {
        total = item.unitPrice*item.qty;
      }
      return total;
    }

    function getSubTotal() {
      var total = 0;

      for (var i = vm.quote.items.length - 1; i >= 0; i--) {
        var unitTotal = getItemTotalPrice(vm.quote.items[i]);
        total += unitTotal;
      };

      return total;
    }

    function getVatTotal() {
      var total = 0;

      total = getSubTotal() * 0.14;

      return total;
    }

    function getTotal() {
      var total = 0;

      total = getSubTotal() + getVatTotal();

      return total;
    }

    function cancel() {
      $location.path( "/");
    }

    function save() {
      validationUtils.setDirty(vm.form);

      if (!vm.form.$valid) {
        return;
      }

      console.log("Quote successfully saved: ", vm.quote);



      //Generate the js pdf

      var imgData = 'data:image/jpeg;base64,';
      var doc = new jsPDF();

      doc.addImage(imgData, 'JPEG', 10, 8, 52, 13);

      doc.setTextColor(0);
      doc.setFontSize(12);
      doc.setFontType("bold");
      doc.text(10, 30, 'TEL: 012 800 11 69/8  FAX: 012 800 1772');

      doc.setFontSize(16);
      doc.setTextColor(0);
      doc.setFontType("bold");
      doc.text(100, 20, 'EXCEPTIONAL SERVICE \nSINCE 1979');

      addQuoteTable(doc, 35);

      doc.save('Quote.pdf');


      $location.path( "/");

    }

    function addQuoteTable(doc, startY) {

      addDocHeader(doc, startY);

      for (var i = 0; i < vm.quote.items.length; i++) {
        var item = vm.quote.items[i];
        addDocRow(doc, item, i, startY + 5);
      };

      addSubTotalsFooter(doc, startY + 10);
      addVatTotalsFooter(doc, startY + 16);
      addTotalsFooter(doc, startY + 22);


    }

    function addDocHeader(doc, startY) {

      var posY = startY;

      doc.setTextColor(0);
      doc.setFontSize(10);
      doc.setFontType("bold");
      doc.text(12, posY , "WINDOW");
      doc.text(50, posY , "SIZE (B X H)");
      doc.text(75, posY , "QTY");
      doc.text(90, posY , "DESCRIPTION");
      doc.text(140, posY , "UNIT PRICE");
      doc.text(170, posY , "TOTAL PRICE");

      doc.line(10, posY+1, 200, posY+1);

    }

    function addDocRow(doc, item, count, startY) {

      var spacing = 6;
      var posY = startY;

      doc.setTextColor(0);
      doc.setFontSize(8);
      doc.setFontType("helvetica");
      doc.text(12, posY + (count * spacing), item.name);
      doc.text(50, posY + (count * spacing), item.size);
      doc.text(75, posY + (count * spacing), item.qty + "");
      doc.text(90, posY + (count * spacing), item.description);
      doc.text(140, posY + (count * spacing), "R " + item.unitPrice);
      doc.text(170, posY + (count * spacing), "R " + getItemTotalPrice(item));

    }

    function addSubTotalsFooter(doc, startY) {

      var spacing = 6;
      var posY = startY + (vm.quote.items.length * spacing);

      doc.setTextColor(0);
      doc.setFontSize(11);
      doc.setFontType("bold");
      doc.text(140, posY , "SUB TOTAL");
      doc.text(170, posY , "R " + getSubTotal());

      doc.line(10, posY-5, 200, posY-5);

    }

    function addVatTotalsFooter(doc, startY) {

      var spacing = 6;
      var posY = startY + (vm.quote.items.length * spacing);

      doc.setTextColor(0);
      doc.setFontSize(11);
      doc.setFontType("bold");
      doc.text(140, posY , "VAT");
      doc.text(170, posY , "R " + getVatTotal());

    }

    function addTotalsFooter(doc, startY) {

      var spacing = 6;
      var posY = startY + (vm.quote.items.length * spacing);

      doc.setTextColor(0);
      doc.setFontSize(11);
      doc.setFontType("bold");
      doc.text(140, posY , "TOTAL");
      doc.text(170, posY , "R " + getTotal());

      doc.rect(10, 30, 190, posY-26);

    }

    function add() {
      console.log("Add item to quote ", vm.quote);

      var item = {        
        name: "",
        size: "",
        qty: 1,
        description: "",
        unitPrice: 0
      };

      vm.quote.items.push(item);

    }

    function remove(item) {
      console.log("Remove item from quote ", item);
      if (vm.quote.items.length > 1) {
        var index = vm.quote.items.indexOf(item);
        vm.quote.items.splice(index, 1);
      }

    }

  }

})();
